import React from "react";

const home = () => {
  return (
    <div>
      <main>
        <div class='homeMap'>
          <div class='kartenHome'>
            <div class='homeSlider'>
              <button class='homeButtonCgn'>1</button>
              <button class='homeButtonCgn'>2</button>
              <button class='homeButtonCgn'>3</button>
              <button class='homeButtonCgn'>4</button>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default home;
